import Button from "../../Button";

const Learn_Middle = ({
  title,
  describe,
  link1,
  link1_label,
  link2 = null,
  link2_label = null,
}) => {
  return (
    <section>
      <h2>{title}</h2>
      <p>{describe}</p>
      <Button to={to} label={link1_label} outline />
      {link2 && <Button to={to} label={link1_label} outline />}
    </section>
  );
};

export default Learn_Middle;
